import React, { Component } from 'react';
import "./style.css";

export default class Gallery extends Component {
  render() {
    return (
      <div className="gallery">
        <h1>Galeria</h1>
          <p>
            Esta pagina ainda se enconra em construção.
            <br />
            Solicitamos que retorne em alguns dias.
          </p>
      </div>
    )
  }
}
